import React from 'react';
import Button from '../Button/Button';
import Post from '../Post/Post';
import styles from './Profile.module.css';
const Profile = (props) => {
  const post = [
    {
      imageGroup: 'https://memax.club/wp-content/uploads/2019/05/55-176.jpg',
      groupName: 'Group 3',
      dataPost: 'Data Post',
      description: 'Description',
      imagePost: 'https://memax.club/wp-content/uploads/2019/05/55-176.jpg',
      amountLike: 12,
      amountPost: 15,
      amountReposts: 8,
      id: 3,
    },
    {
      imageGroup: 'https://memax.club/wp-content/uploads/2019/05/55-176.jpg',
      groupName: 'Group 2',
      dataPost: 'Data Post',
      description: 'Todays',
      imagePost: 'https://memax.club/wp-content/uploads/2019/05/55-176.jpg',
      amountLike: 12,
      amountPost: 15,
      amountReposts: 8,
      id: 2,
    },
    {
      imageGroup: 'https://memax.club/wp-content/uploads/2019/05/55-176.jpg',
      groupName: 'group 1',
      dataPost: 'Data Post',
      description: 'Description',
      imagePost: 'https://memax.club/wp-content/uploads/2019/05/55-176.jpg',
      amountLike: 12,
      amountPost: 15,
      amountReposts: 8,
      id: 1,
    },
  ];

  return (
    <div>
      {/* {post.map((post) => (
        <Post
          key={post.id}
          imageGroup={post.imageGroup}
          groupName={post.groupName}
          dataPost={post.dataPost}
          description={post.description}
          imagePost={post.imagePost}
          amountLike={post.amountLike}
          amountPost={post.amountPost}
          amountReposts={post.amountReposts}
        />
      ))} */}
    </div>
  );
};

export default Profile;
